import React, { Component } from 'react';


class ForoPost extends Component {
    render() {
        return (
            <div>
                <tr>
                <h3>{this.props.title}</h3>
                </tr>
                <span>{this.props.date}</span>
                <span>{this.props.hour}</span>
                <span>{this.props.author}</span>
            </div>
        )
    }
}

export default ForoPost
